import React, { Fragment } from 'react';
import { useForm } from 'react-hook-form';
import { useHistory } from 'react-router-dom';
import Reaptcha from 'reaptcha';

import style from './Login.module.css';

import Navbar from '../../layouts/Navbar';
import Container from '../../layouts/Container';
import Wrapper from '../../layouts/Wrapper';

import username_logo from '../../assets/images/username_logo.png';
import password_logo from '../../assets/images/password_logo.png';
const Login = (props) => {
    const { register, handleSubmit, errors } = useForm();
    const onSubmit = (data) => console.log(data);
    const verifyCallback = (response) => {
      console.log(response);
    };
  
    const onLoadCallback = () => {
      console.log('done');
    };
    return(
        <Fragment>
          <Navbar lang_enable={true} />
          <Container>
              <Wrapper>
              <div className={style.container}>
            <p className={style.title}>Sign in</p>
            <form
              className={style.form_wrapper}
              onSubmit={handleSubmit(onSubmit)}
            >
                <div className={style.form_group}>
                <div className={style.input_section}>
                  <img
                    className={style.input_icon}
                    src={username_logo}
                    alt=''
                  />
                  <input
                    className={style.input_box}
                    name='username'
                    placeholder='User Name'
                    ref={register({ required: true })}
                  />
                </div>
                {errors.username && (
                  <span className={style.error}>Username is required</span>
                )}
              </div>
              <div className={style.form_group}>
                <div className={style.input_section}>
                  <img
                    className={style.input_icon}
                    src={password_logo}
                    alt=''
                  />
                  <input
                    className={style.input_box}
                    name='password'
                    type='password'
                    placeholder='Password'
                    ref={register({ required: true })}
                  />
                </div>
                {errors.password && (
                  <span className={style.error}>Password is required</span>
                )}
                  <div className={style.form_group_recaptcha}>
                <Reaptcha
                  sitekey='6LfLwsIZAAAAAId5K1CaLo6YQdvecE1Ip3HAMgVS'
                  onLoad={onLoadCallback}
                  onVerify={verifyCallback}
                  // explicit
                />
              </div>
                  <input className={style.submit_btn} type='submit' value='LOGIN' />
             {/* <a href='#!' className={style.forgot_password}>
                Forgot password
              </a>*/}
              </div>


            </form>
            </div>
              </Wrapper>
         </Container> 
        </Fragment>
    )
}
export default Login;
